import { Outlet, Link } from "react-router-dom";
import React from "react";
const Home = () => {
    return <>
    <h1 class="title">Home</h1>
    <h2>Berechnen Sie Ihren Schaden in wenigen Schritten - schnell und einfach!</h2>
    <p>Unser Schadensrechner ist ein einfaches Tool, mit dem Sie schnell und genau den Schaden an Ihrem Auto, Haus oder anderen Gegenständen berechnen können. Geben Sie einfach einige Informationen ein, und unser Rechner erledigt den Rest.
    </p>
    <Link class="linkname" to="/calculator">Jetzt berechnen!</Link>
    </>
    
  };
  
  export default Home;
